const DateContainer = () => {
  const month = ["January", "February", "March", "April", "May", "June", 
  "July", "August", "September", "October", "November", "December"];
  const days = getDays();

  return (
    <div id="date-container">
      <select id="month-select">{month.map(createMonthsOptions)}</select>
      <select id="day-select">{days.map(createDaysOption)}</select>
      <select id="year-select"></select>
    </div>
  )
}


const createMonthsOptions = (element, index) => {
  return <option value={index} key={index}>{element}</option>;
}

const createDaysOption = (element, index) => {
  return <option value={index} key={index}>{element}</option>
}

function getDays() {
  const maxDays = 30;// in the end 31
  const days = new Array(maxDays);
  for(let i = 0; i <= maxDays; i++) { days[i] = i + 1; }
  return days;
}

export default DateContainer;
